const Navbar = () => {
    return ( 
        <nav className="navbar">
            <div className="links">
                <a href="/">ABOUT</a>
                <a href="/">SERVICES</a>
            </div>
            <div className="links2">
                <a href="/">FR</a>
                <a href="/create" style={{
                    color: '#5D4F85',
                    backgroundColor: 'white',
                    borderRadius: '10px',
                    borderColor: '#5D4F85',
                }}>Book now</a>
            </div>
        </nav>
    );
}

export default Navbar;
